import React from 'react';
import './Header.css'; 
import Nav from './Nav';

const Header = ({onRouteChange, isSignedIn}) => {
	return (
		<header>
			<div>
				<Nav onRouteChange={onRouteChange} isSignedIn={isSignedIn}/>
			</div>
			<div className='background-image-container'>
			</div>
	    </header>
	);
}

export default Header;
